import './Landing.css';

import { Link } from "react-router-dom"

const Landing = () => {
    return (

        <div className='landinContent' >
            <img src="../../../../../../../../pokemon.png" alt="" />
            <h1 className='titulo'>LANDING PAGE </h1>
            <h4>pagina de inicio</h4>
            <h5>Lorem ipsum dolor sit amet consectetur adipisicing elit. Nisi iste possimus veritatis debitis! Dolorum quasi ratione quia ullam, hic aperiam praesentium explicabo natus repellat accusamus vero non illo fugit expedita.</h5>

            <br />
            <h5>click para entrar</h5>
            <Link to="home">#### HOME ####</Link>
        </div>

    )
}

export default Landing;
